*
 * 打开活动的分享（最新的API：share-url）
 *
 * 支持平台：书旗Android、书旗iOS
 *
 * @returns {Promise<*>}
 *
 * @example 调用示例
 *  libSQ.exec('open-activity-send-share', {
 *    params: {
 *     "platform": "all", //分享的平台,all:全平台;qq:qq分享
 *     "shareUrl": 'http://booktouch.devwx.uae.uc.cn/route.php?ct=welfare&id=500087', //分享的url
 *     "imgUrl": "", //图片url
 *     "shareTitle": '测试测试', //分享的title
 *     "shareContent": '发个测试内容', //分享的content
 *     "shareFrom": "act_310_project",
 *    }
 *  }).then(function (info) {
 *    alert('[from ready][open-activity-send-share][then] ' + JSON.stringify(info, null, 2));
 *  }).catch(function (err) {
 *    alert('[from ready][open-activity-send-share][error] ' + JSON.stringify(err, null, 2));
 *  });
 *

